input = ['',
'',
'',
'',
''];

var position = {x: 1, y: 1};
var numpad = {row0: [1, 2, 3], row1: [4, 5, 6], row2: [7, 8, 9]}
var code = "";

for (i in input) {
    setEndCoordinates(input[i]);
    code += translateCoordinates();
}
console.log('The code is: ' + code)

function setEndCoordinates(input){
    for (i in input) {
        if (input[i] === 'U' && position.y > 0) position.y--;
        else if (input[i] === 'D' && position.y < 2) position.y++;
        else if (input[i] === 'L' && position.x > 0) position.x--;
        else if (input[i] === 'R' && position.x < 2) position.x++;
    }
}

function translateCoordinates() {
    let row = numpad["row"+position.y]
    return row[position.x]
}


